import React from 'react';
// with es6
import {BootstrapTable, TableHeaderColumn} from 'react-bootstrap-table';
import '../../node_modules/react-bootstrap-table/dist/react-bootstrap-table-all.min.css';
// // with es5
// var ReactBsTable = require('react-bootstrap-table');
// var BootstrapTable = ReactBsTable.BootstrapTable;
// var TableHeaderColumn = ReactBsTable.TableHeaderColumn;
// require('../../node_modules/react-bootstrap-table/dist/react-bootstrap-table-all.min.css');
var products = [{
    name: "Product1",
    manufacturer:'Ford',
    price: 120
}, {
    name: "Product2",
    manufacturer:'Fordss',
    price: 80
}];

class Car_table extends React.Component {
    constructor(props) {
      super(props);
      this.options = {
        defaultSortName: 'name',  // default sort column name
        defaultSortOrder: 'desc'  // default sort order
      };
    }
    
    render() {
      return (
        <div>
          <BootstrapTable data={ products } options={ this.options } hover  version='4'>
            <TableHeaderColumn dataField='name' isKey dataSort>Manufacturer</TableHeaderColumn>
            <TableHeaderColumn dataField='name' dataSort>Make</TableHeaderColumn>
            <TableHeaderColumn dataField='price' dataSort>Model</TableHeaderColumn>
            <TableHeaderColumn dataField='price' >Year</TableHeaderColumn>
            <TableHeaderColumn dataField='price'> </TableHeaderColumn>
          </BootstrapTable>
        </div>
      );
    }
  }

  export default Car_table;
